import React from 'react';
import '../App.css';
import  './Home.css';
import { Button } from '../components/Button';
import { ReactComponent as Logo } from '../assets/theMet.svg';

function Home() {
  return (
    <>
      <main className='hero-container'>
        <div className='headings'>
          <Logo className='main-logo'></Logo>
          <h1>Discover Art Like Never Before</h1>
          <div className="cta-buttons">
            <Button buttonStyle='btn--landing' to='/tour' >Tour the Art</Button>
            <Button buttonStyle='btn--nav' to='/education' >Learn About the Art</Button>
          </div>
        </div>
      </main>
    </>
  );
}

export default Home;
